import "./HotDrinksMenuPage.css";
import HotDrinks from "../Hot Drinks/HotDrinks";

function HotDrinksMenuPage() {
  return (
    <>
      <h2>Топли пијалоци</h2>
      <div className="hot-drinks-container">
        {HotDrinkslist()}
      </div>
    </>
  );
}

  let hotDrinks = [
    {
      name: "Caj filter",
      price: "90.00",
    },
    {
      name: "Esspreso",
      price: "80.00",
    },
    {
      name: "Makiato",
      price: "90.00",
    },
    {
      name: "Duplo Esspreso",
      price: "120.00",
    },
    {
      name: "Golemo Makiato",
      price: "100.00",
    },
    {
      name: "Kapucino",
      price: "100.00",
    },
  ];
  function HotDrinkslist() {
    let lists = [];

    for (let i = 0; i < hotDrinks.length; i++) {
      let list = (
        <div>
          <HotDrinks hotDrink={hotDrinks[i]} />
        </div>
      );
      lists.push(list);
    }

    return pages;
  }


export default HotDrinksMenuPage;
